import { ComponentMeta, ComponentStory } from "@storybook/react";
import React from "react";
import UploadImageOptions from "./UploadImageOptions";
import UploadImage from "../../../../public/assets/upload.png";
import LockIcon from "../../../../public/assets/lock-icon.svg";
import ThreeDots from "../../../../public/assets/more.png";
import BoxIcon from "../../../../public/assets/Boxplus-icon.png";


export default {
  title: "Molecules/ImageUploadOptions",
  component: UploadImageOptions,
} as ComponentMeta<typeof UploadImageOptions>;

const Template: ComponentStory<typeof UploadImageOptions> = (args) => (
  <UploadImageOptions {...args}></UploadImageOptions>
);

const options = [
  {
    src: UploadImage,
    action: () => console.log("Clicked"),
  },
  {
    src: ThreeDots,
  },
  {
    src: BoxIcon,
  },
  {
    src: LockIcon,
  },
];

export const primary = Template.bind({});
primary.args = {
  options: options,
};



